The core bundle exports the special org.corpus_tools.hexatomic.core.errors.ErrorService service which should be used to display error messages to the user. To report an exception, simply call the handleException(...) function of the service with an error message, the exception object, and the class of the caller, i.e., the class in which you catch the exception. project = SaltFactory.createSaltProject();
try { project.loadCorpusStructure(path);
} catch (SaltException ex) { // In this example the calling function is part of the ProjectManager class. errorService.handleException("Cannot load project from " + path.toString(), ex, ProjectManager.class);
